import React from 'react'

const AuntificationPage = () => {
	const handlerlogin = () => {
		const clientId = '1174699836294053968'
		//const clientSecret = ''
		const redirect = 'http://localhost:3000/'
		window.location.href = `https://discord.com/api/oauth2/authorize?client_id=${clientId}&redirect_uri=${redirect}&response_type=code&scope=identify`
	}
	return (
		<div>
			<button onClick={handlerlogin}></button>
		</div>
	)
}

export default AuntificationPage
